import React, { Component } from "react";
import { Card } from "react-bootstrap";
import { Button } from "bootstrap";

class Mobile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      mabile: [
        {
          name: "",
          price: "",
          imgurl: "",
        },
      ],
    };
  }
  render() {
    return;
    <></>;
  }
}

export default Mobile;
